import React from 'react'
import fetch from 'isomorphic-unfetch'

import { Row, Col, Card, InputGroup, Button } from 'react-bootstrap'
// american-sign-language-interpreting
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUsers, faUserPlus } from '@fortawesome/free-solid-svg-icons';
import { faThumbsUp } from '@fortawesome/free-regular-svg-icons';

import GlobalStyleSheet from '../../../../../styleSheet'

class Inventory extends React.Component {
    // static async getInitialProps(ctx) {
    //     const res = await fetch('https://api.github.com/repos/zeit/next.js')
    //     const json = await res.json()
    //     return { stars: 10 }
    // }

    render() {
        return (
            <div style={{ width: '100%', background: 'yellow' }}>
                <Tabs defaultActiveKey="daily" transition={false} id="reports_tab" style={{ padding: '0px', margin: '0px', width: '100%' }}>
                    <Tab eventKey="daily" title="Daily Reports">
                        <p>Daily Reports</p>
                    </Tab>
                    <Tab eventKey="weekly" title="Weekly Reports">
                        <p>Weekly Reports</p>
                    </Tab>
                    <Tab eventKey="monthly" title="Monthly Reports">
                        <p>Monthly Reports</p>
                    </Tab>
                    <Tab eventKey="yearly" title="Yearly Reports">
                        <p>Yearly Reports</p>
                    </Tab>
                    <Tab eventKey="overall" title="Overall Reports">
                        <p>Overall Reports</p>
                    </Tab>
                </Tabs>
                <style jsx>
                    {`
                        .hover {
                            margin: 5px 15px
                        }
                        .hover:hover {
                            margin: 0px 10px;
                            cursor: pointer
                        }
                    `}
                </style>
            </div>
        )
    }
}

const styles = {
    row: {
        margin: '2%',
        padding: '0px'
    },
    col: {
        padding: '0px',
        margin: '0px'
    },
    card: {
        background: 'white',
        borderRadius: '0px',
        padding: '0px'
    },
    card_header: {
        background: 'white',
        color: 'gray',
        border: 'none'
    },
    card_text: {
        color: '#6A7074',
        fontSize: '30px',
    },
    fontawesome: {
        color: `${GlobalStyleSheet.primry_color}`,
        width: '50px',
        height: '50px',
        maxHeight: '50px',
        maxWidth: '50px',
        float: 'right'
    },
}

export default Inventory;
